package in.co.rays.basics;

public class AddEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 26;
		int b = 50;
		int c = 12;
		int d = 25;
		int total = a/b*c%d;
		int value = a%b*c/d;
		
		System.out.println(total);
		System.out.println(value);
		
		
		

	}

}
